import './App.css';

function Products(image,name,price) {
  return (
    <div className="App">
      <header className="App-header">
        <div className = "cookiesList">
            <div className = "cookie">
                <img src={image}></img>
                <h3>{name}</h3>
                <p>{price} K.D.</p>
            </div>
        </div>
      </header>
    </div>
  );
}

export default Products;
